    try {
      const response = await axios.post('http://localhost:5000/', 'Hello, Anika!');
      //console.log(response.data);
      console.log(response.data.processed_message);


    } catch (error) {
      console.error(error);
    }
  };

  return (
    <div>
      <h1>{response.data.processed_message}</h1>
      <button onClick={handleSubmit}>Send to Backend</button>
    </div>
  );
};

export default App;
